import { useEffect, useState } from "react";

import BaseTable from "../BaseTable/BaseTable";

import "./App.css";

function App() {
  const [tableData, setTableData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setTableData([]);
      } catch (err) {
        console.log(err);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="App">
      <header className="App-header">TEST TABLE</header>
      <BaseTable />
    </div>
  );
}

export default App;
